    uint256 public contractStartTime;
    uint256 public totalSavings;
    uint256 public totalLoaned;

    struct Member {
        bool isMember;
        uint256 totalSavings;
        uint256 loanAmount;
        uint256 lastLoanTimestamp;
    }
